import React from "react";

const CustomiFrame = React.memo(({ src }) => (
  <iframe
    src={src}
    width="80%"
    height="300"
    frameBorder="0"
    allowtransparency="true"
    allow="encrypted-media"
  ></iframe>
));

export default CustomiFrame;
